import React from 'react';
import './App.css';
import Home from './Components/Home/Home';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Login from './Components/LogIn/Login';

function App() {
  return (
    <Router>
    <Switch>
    <Route path="/home">
      <Home />
    </Route>
    <Route path="/login">
      <Login/>
    </Route>

  </Switch>

</Router>
  );
}

export default App;
